import React, { useEffect, useRef } from 'react';
import { Line } from 'react-chartjs-2';

const Results = () => {
  const chartRef = useRef(null);

  useEffect(() => {
    let chartInstance = null;

    const renderChart = () => {
      if (chartRef.current && chartRef.current.chartInstance) {
        // Destroy the existing chart instance
        chartRef.current.chartInstance.destroy();
      }

      // Render the new chart instance
      chartInstance = new Line(chartRef.current.chartInstance, {
        data: data,
        options: options,
      });
    };

    renderChart();

    // Cleanup function
    return () => {
      if (chartInstance) {
        // Destroy the chart instance on unmounting
        chartInstance.destroy();
      }
    };
  }, []);

  const list1 = [1, 2, 3, 4, 5];
  const list2 = [3, 2, 5, 1, 6];
  const list3 = [2, 4, 1, 5, 3];
  const list4 = [5, 2, 4, 1, 3];
  const list5 = [4, 1, 3, 2, 5];

  const data = {
    labels: ['Label 1', 'Label 2', 'Label 3', 'Label 4', 'Label 5'],
    datasets: [
      {
        label: 'List 1',
        data: list1,
        borderColor: 'red',
        backgroundColor: 'transparent',
      },
      {
        label: 'List 2',
        data: list2,
        borderColor: 'blue',
        backgroundColor: 'transparent',
      },
      {
        label: 'List 3',
        data: list3,
        borderColor: 'green',
        backgroundColor: 'transparent',
      },
      {
        label: 'List 4',
        data: list4,
        borderColor: 'orange',
        backgroundColor: 'transparent',
      },
      {
        label: 'List 5',
        data: list5,
        borderColor: 'purple',
        backgroundColor: 'transparent',
      },
    ],
  };

  const options = {
    // Add any desired options here
  };

  return (
    <div>
      <canvas ref={chartRef} />
    </div>
  );
};

export default Results;
